import styled from "styled-components";

export const Container = styled.header`
    width: 100%;
    height: 55px;
    background-color: black;
    padding: 0 16px;
    box-sizing: border-box;
    display: flex;
    align-items: center;
`;

export const GuiasContainer = styled.div`
    width: 200px;
    height: 40px;
    font-size: 16px;
    align-items: center;
    justify-content: space-between;
    row-gap: 10px;
    font-weight: bold;
    color: #fff;
`;
